INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (1, "えっと、今日はありがとう……！\nでもこんな立派なお誕生日ケーキ、\n本当にもらってもいいの？\nお金とか、大丈夫だった……？", 11, 10, 103611, 0.5, 1, 35314, 35314058, 0, 0);
